import React, { useState, useEffect } from 'react';
import { Container, Row, Col } from 'react-bootstrap';
import '../assets/styles/wedding-timeline.css'; // Import your custom CSS for styling
import weddingring from '../assets/images/icons/wedding-rings.png';

const WeddingTimeline = () => {
  const [isVisible, setIsVisible] = useState(false);

  useEffect(() => {
    const handleScroll = () => {
      const section = document.querySelector('.timeline-section');
      const sectionTop = section.getBoundingClientRect().top;
      const viewportHeight = window.innerHeight;
      
      if (sectionTop < viewportHeight * 0.75) {
        setIsVisible(true);
      }
    };

    window.addEventListener('scroll', handleScroll);
    return () => window.removeEventListener('scroll', handleScroll);
  }, []);

  return (
    <section className={`timeline-section background-gray ${isVisible ? 'visible' : ''}`}>
      <Container fluid id = "schedule">
        <Row className="justify-content-center">
          <Col md={12} className="text-center">
            <h1 className="global-title-template"> Timeline </h1>
          </Col>
        </Row>
        <Row className="justify-content-center margin-top-55 margin-bottom-140">
            <Col md={2}></Col>
            <Col md={8}>
                <Row>
                     {/* Horizontal Center Line */}
                    <div className="timeline-line"></div>

                    {/* Timeline Event 1 */}
                    <Col md={6} className="timeline-event text-right">
                        <div className="timeline-content">
                            <h5 className="event-time">10:00 AM</h5>
                            <p className="event-title">Ceremony Begins</p>
                        </div>
                    </Col>
                    <Col md={6} className="timeline-icon">
                        <div className="timeline-dot">
                            <img src={weddingring} alt="Ceremony Icon" className="timeline-img" />
                        </div>
                        <div className="vertical-line"></div>
                    </Col>

                    {/* Timeline Event 2 */}
                    <Col md={6} className="timeline-icon">
                        <div className="timeline-dot">
                            <img src={weddingring} alt="Ceremony Icon" className="timeline-img" />
                        </div>
                        <div className="vertical-line"></div>
                    </Col>
                    <Col md={6} className="timeline-event text-left">
                        <div className="timeline-content">
                            <h5 className="event-time">1:00 PM</h5>
                            <p className="event-title">Reception</p>
                        </div>
                    </Col>

                    {/* Timeline Event 3 */}
                    <Col md={6} className="timeline-event text-right">
                        <div className="timeline-content">
                            <h5 className="event-time">3:00 PM</h5>
                            <p className="event-title">Cake Cutting</p>
                        </div>
                    </Col>
                    <Col md={6} className="timeline-icon">
                        <div className="timeline-dot">
                            <img src={weddingring} alt="Ceremony Icon" className="timeline-img" />
                        </div>
                        <div className="vertical-line"></div>
                    </Col>

                    {/* Timeline Event 4 */}
                    <Col md={6} className="timeline-icon">
                        <div className="timeline-dot">
                            <img src={weddingring} alt="Ceremony Icon" className="timeline-img" />
                        </div>
                        <div className="vertical-line"></div>
                    </Col>
                    <Col md={6} className="timeline-event text-left">
                        <div className="timeline-content">
                            <h5 className="event-time">5:00 PM</h5>
                            <p className="event-title">First Dance</p>
                        </div>
                    </Col>
                </Row>

            </Col>
            <Col md={2}></Col>
        </Row>
      </Container>
    </section>
  );
};

export default WeddingTimeline;
